import Box from '@mui/material/Box';
import { Typography } from "@mui/material";
import Username from "./Username";

const LoginForm = () => {
    return (
            <Box 
                height={500}
                width={500}
                my={4}
                mx={55}
                display="flex"
                alignItems="center"
                gap={4}
                p={2}
            sx={{ border: '2px solid grey', fontFamily: 'sans-serif' }}
        >
            <Username />
            <Typography
                variant="h1"
                mb={50}
                mx={18}
                alignItems="center"
            >
                Buzz
            </Typography>
        </Box>

    )
}

export default LoginForm
